# frozen_string_literal: true

module Api
  class SessionsController < ApplicationController
    before_action :authenticate_user!, only: %i[index]
    before_action :add_user_for_test

    # GET /api/sessions
    def show
      @user = current_user
      authenticate_user!

      make_response 0, '', @user
    end

    # POST /api/sessions
    def create
      address = login_params[:address]
      @user = User.find_by!(address:)
      raise ApplicationErrors.ApplicationError.new(not_found, 404, 'user not found') if @user.nil?

      # check message and signature
      verify_message!(login_params[:message], login_params[:sign_hex], address)

      login(@user)

      make_response 0, '', @user, :created
    end

    # DELETE /api/sessions
    def destroy
      logout
    end

    # GET /api/sessions/message_for_login
    def create_message
      make_response 0, '', 'Welcome back to MERC'
    end

    private

    # TODO: remove this
    def add_user_for_test
      # User.create address: '0x96079c6b319539baa0c0f6d118d7609166c39b01', nickname: 'Tester 1', gender: 'Male', avatar: 'data:image/png;base64,' if User.find_by(address: '0x96079c6b319539baa0c0f6d118d7609166c39b01').nil?
      # User.create address: '0xea87d877fa9ed07ced78242224c2c826e3379b89', nickname: 'Tester 2', gender: 'Female', avatar: 'data:image/png;base64,' if User.find_by(address: '0xea87d877fa9ed07ced78242224c2c826e3379b89').nil?
    end

    def login_params
      params.require(:user).permit(:address, :message, :sign_hex)
    end
  end
end
